import "./index.css";
import ComA from "./ComA";
import ComB from "./ComB";
import ComC from "./ComC";

const App = ()=>{
	return(
	<div className="Container">
	<div className="top">
	<div className="topIn" >
	<span className="topContent">Quikie</span>
	<span className="topContent1">Apps</span>
	</div>
	</div>
<div className="cont">
   <ComA/>
   <ComB/>
   <ComC/>
   </div>

	</div>
	)
};

export default App;
